"use strict"; 
(function($) {
	var that = $.auth || {};
	$.auth = that;
	that.notify = function(event, eventData) {
		switch (event) {
			case "pagechange":
				that.resetData(eventData);
				break;
			case "pageload":
				that.loadData(eventData);
				break;
		}
		return eventData;
	};
	that.resetData  = function () {
	};
	that.loadData  = function () {
	};
	
})(jQuery); 